import React from 'react';
import './UserItem.css';

function UserItem(props) {
    const {name, email, isGoldClient,salary} = props;
    
    return (
        
        <div className="col-md-8">
            <h3>{ name }</h3>
            <p>{ email }</p>
            <p>{ salary }</p>
            <img src='/images/profil.gif' alt="imagine indisponibila " />
            { isGoldClient
                ? <h3>Client GOLD</h3>
                : null
            }
            
        </div>
        
    );
}

export default UserItem;
